const blogList = (props) => {
    blogs = props.blogs 
    //titile = props.titile

    return (  
        <div className="glog-list"> 

        {blogs.map((blog) => (
            <div className="blog-preview" key={blog.id}>
                <h2>{blog.title}</h2>
                <p>written by: {blog.body}</p>

            </div>
        ))}
        </div>

    );
}

export default blogList;
